import Skill from "./Skill";

import classes from "./SkillList.module.css"

const url = "https://upload.wikimedia.org/wikipedia/commons/thumb/6/61/HTML5_logo_and_wordmark.svg/1200px-HTML5_logo_and_wordmark.svg.png"

const skills=[
  {name: "Html" ,imgUrl:""},
  {name: "ReactJs" ,imgUrl:""},
  {name: "Javscript" ,imgUrl:""}
]

const SkillList = () => {

  return <div className={classes["skill-grid"]}>
    <Skill skillArr={skills}/>
  </div>

};

export default SkillList;
